v = linspace(0,1.2,1000);

Vp = 0.1;
Ip = 1;
Vv = 0.6;
Iv = 0.1;
Vi = 1;
Ii = 1;

C = 1;
L = 1;
R = 1;
E = 0.8;

h = @(v) Ip*v/Vp.*exp(1 - v/Vp) + 100*exp(-1./((v-0.06)/2).^2); % - Iv*v/Vv.*exp(1 - v/Vv) + Ii*v/Vi.*exp(1 - v/Vi);
i = h(v);

plot(v, i, v, (E-v)/R); %[output:21e90aec]
xlabel('Voltage (V)'); %[output:21e90aec]
ylabel('Current (I)'); %[output:21e90aec]
title('Current vs Voltage Characteristic'); %[output:21e90aec]
grid on; %[output:21e90aec]
f1 = @(x1,x2) 1/C*(-h(x1) + x2);
f2 = @(x1,x2) 1/L*(-x1 - R*x2 + E);

[x1,x2] = meshgrid(linspace(0,1.2,200),linspace(0,1.2,200));
f1_val = f1(x1,x2);
f2_val = f2(x1,x2);

streamslice(x1,x2,f1_val,f2_val) %[output:21e90aec]
axis([0,1.2,0,1.2]) %[output:21e90aec]
 

